import './App.css';


import Musicplayer from './Musicplayer.js';


function App() {
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Simulate loading for 5 seconds
    const timer = setTimeout(() => {
      setIsLoading(false);
    }, 5000);

    return () => clearTimeout(timer);
  }, []);
  return (
    <>

      <Musicplayer/>
    </>
  );
}

export default App;
